import { Container } from "./styles";

const Header = () => {
  return (
    <Container>
      <h1>Kenzie Shop</h1>
      <div className="menu">
        <button>Cart</button>
        <button>Login</button>
      </div>
    </Container>
  );
};

export { Header };
